import'./Header.css'
function Header() {
    return (
        <div className='header-site'>
            <h1 className='header-site__name'>Some <br/>
                Name</h1>
            <h2 className='header-site__profession'><i>Developer</i></h2>
            <div className='header-site__info-container'>
                <h3 className='header-site__profession-info'>CONTACT INFO:</h3>
                <ul className='header-site__list'>
                    <li className='header-site__list-item'>Telegram: @Liseczkij</li>
                    <li className='header-site__list-item'>Mail: liseczkij2@gmai.com</li>
                    <li className='header-site__list-item'>Instagram: lisetskiiy__</li>
                </ul>
            </div>
        </div>
    );
}
export default Header;
